    - |
      Taco salad
      
      1.5 heads Romaine lettuce 
      1 orange or yellow bell pepper
      1/4 large white onion
      2 tsp cumin
      1 tsp paprika
      1 tsp chili powder
      3 tbsp ranch dressing 
      1 avocado - cubed
      3 medium vine-ripened tomatoes, chopped
      1 16 oz can black beans, drained
      1/2 c. shredded cheese of choice (optional)
      3/4 c. salsa
      handful tortilla chips, crushed (optional)
      
      ***
      Dressing: 
      Combine salsa, salad dressing, 1 tsp cumin, and paprika in a small bowl.  Stir until combined.
      
