      Creamy Tomato Sauce with Pasta Shells
      
      2 cups pasta shells
      1/4 lb (6 slices) of bacon
      8 oz mushrooms, sliced
      2 large tomatoes, diced
      1/3 cup white wine
      1/4 cup water
      salt and pepper
      1 tbsp dried basil
      1 tsp sugar
      1/4 cup cream cheese
      2 tbsp butter
      
      
      **
      
      1. Bring a pot of salted water to a boil.
      2. Cook pasta until al dente, keep stirring and checking every 3 minutes. Once cook, drain and set aside.
      3. Lay bacon strips in a cold pan, put over medium heat.
      4. Cook until fat has turned translucent. Remove.
      5. In the same pan, turn heat to medium-high, cook mushrooms until lightly brown.
      6. Toss in tomatoes, cook for about 3 minutes.
      7. Deglaze pan with white wine, then add in water.
      8. Simmer until liquid is half reduced.
      9. season with salt, pepper, basil and sugar.
      10. Stir in cream cheese and butter. The sauce should be a thick creamy consistency.
      11. Fold in pasta shells. Serve.
      
      **serves**
      2
      
      **worktime**
      30-40 min
      
