      Fried okra 
      8 oz okra (ladies' fingers)
      pinch of salt
      2 tablespoons olive oil
      1 teaspoon ground coriander
      1 teaspoon ground cardamom seeds
      8 oz Greek yogurt
      1 teaspoon paprika
      1 tablespoon chopped basil or marjoram
      
      ***
      1. Put the okra into a pan, sprinkle with salt, cover with water and boil for 10 minutes, until just tender.
      2. Drain, pat dry with kitchen paper.
      3. Heat the oil and add the okra. Add the coriander and cardamom and fry gently for 5 minutes, turning occasionally.
      4. Mix the paprika with the yogurt and add to the pan. Heat through, stirring, but do not boil.
