      Spicy Pork Chops with Chunky Tomato Sauce
      
      1 pork tenderloin
      pinch salt
      pinch pepper
      pinch paprika
      pinch chili powder
      1 tbsp olive oil
      
      (Chunky Tomato Sauce)
      2 large tomatoes, diced
      2 onions, diced
      1 pack of mushrooms, halved or quartered
      1/4 - 1/2 water
      1 rounded spoonful tomato paste
      1 tbsp cumin
      1 tbsp oregano
      1 tsp sugar
      
      
      **
      
      1. Cut the pork loin into 1 1/2 inch slices (cut 4).
      2. Marinade each slice with salt, pepper, paprika, chili powder, and olive oil. Sprinkle each spice depending on the intensity of the flavor. 
      3. Meanwhile, in a hot sauce pan, saute the diced tomatoes, onions and mushrooms.
      4. Saute until the onions are translucent.
      5. Add water, tomato paste, cumin, oregano and sugar. 
      6. Stir until everything is combined.
      7. Bring down to a simmer. There should be enough liquid to make it a saucey consistency. 
      8. To cook the slices of pork loin, heat a pan with a drizzle of oil.
      9. Sear both sides of the pork for 4 minutes. Remove and cover with the tomato sauce.
      
