      Stuffed Chicken and Green Beans
      
      2 lbs (4 pieces) boneless chicken thighs
      100 g shaved cajun turkey breast (deli)
      1/2 cup asiago cheese
      pinch salt and pepper
      
      1 tbsp olive oil
      4oz green beans
      
      
      **
      
      1. Season chicken thighs with salt and pepper.
      2. Lay chicken thighs skin side down, and evenly layer on shaved cajun turkey breast and asiago cheese.
      3. Roll chicken up tightly and secure with toothpicks.
      4. Preheat oven to 400F.
      5. Heat a medium, non-stick pan with oil. 
      6. When the pan is hot enough, place the rolls of chicken thighs in the pan to sear the skin.
      7. When all sides are browned evenly, remove and place onto an oven safe pan lined with tin foil.
      8. Bake for 7-10 minutes, or until juices run clear when pierced.
      9. Quickly clean green beans with water and let them sit to dry.
      10. Meanwhile, blanch the green beans for 2 minutes and drain.
      11. Heat a non stick skillet on high heat with oil. 
      12. When the pan starts to smoke, turn heat to medium-high, and carefully place the green beans into the pan and toss continuously.
      13. Season the green beans with salt and pepper. Toss for about 3-5 minutes, and remove. 
      
      **serves**
      3
      
      **worktime**
      30 min
      
      **waittime**
      15 min
      
