      Sundried Tomato Risotto
      
      1 ounce sun-dried tomatoes 
      1 cup water
      2 1/2 cups chicken broth
      1 cup finely chopped onion
      1 garlic clove, minced
      4 tablespoons olive oil
      1 cup Arborio rice (available at specialty foods shops and some  supermarkets)
      1/4 cup freshly grated Parmesan
      finely chopped fresh parsley leaves for sprinkling the risotto if desired
      
      
      ***
      1. Simmer the tomatoes in the water for 1 minute then drain and reserve the liquid.  Chop into strips. Set aside
      2. Combine the tomato liquid and the broth in a pot, and bring to a simmer. 
      3. In a separate pan sautee the onion and garlic in the oil until soft, then add rice and tomatoes and stir until coated with oil.
      4. When the liquid is hot, add 1/2 cup at a time to the pan and and stir until absorbed by the rice.   About 17 minutes 
      5. Stir in the Parmesan and salt and pepper to taste and sprinkle the risotto with the parsley.
      
      
