      Vegetarian Tacos
      
      **intro**
      
      Wow, you will be amazed how much flavor these tacos pack.  The toasted rich flavor of the pumpkin cumin paste will make your family smile and you can play a guessing game to see if they can find out your secret. If you want a quick side dish, in another pan you can heat a can of black beans with 1 Tablespoon of Tabasco. 
      
      
       **ingredients**
      12 Store bought Corn Tortillas 
      2 large Zucchini 
      1/2 Cup Pumpkin Seeds
      1/4 Cup Jarred Roasted Peppers
      1 Cup Corn kernals 
      2 Tablespoon Oil
      
      ((spices))
      1 Taco Seasoning mix package
      2 Tablespoons Pumpkin Seeds
      1 Teaspoon Cumin
      
      **prep**  
      1. Heat a pan on medium, *pan toast* pumpkin seeds and cumin for 3 minutes until they smell wonderful and start to brown,let cool, *blend* into a paste with a teaspoon of water
      
      
      
        **cook**
      1. Cut Zucchini into half circles. (Cut first length-wize, them slice).  Heat oil in Pan, add Zucchini and cook 8 minutes, stir to stop sticking.
      2. Stir in Taco Seasoning, corn, and 1/4 cup water, simmer uncovered for 5 minutes.
      3. Cut Roasted Peppers into thin strips.
      4. Place tortillas on a large plate, cover microwave on high for 45 seconds to steam.
      5. Spread Pumpkin Seed paste on each tortilla, spoon in vegetables, and add a few slices of peppers.
      
      
      **serves**
      4
       
