      Veggie Pita Served Pizza Style
      
      **intro**
      
      This California Cuisine Pizza will be a family favorite.  At first glance they may be startled to see the green guacamole instead of the expected red marinara, but after they taste it they will be bragging about you the next day.  An added bonus is that in prepping guacamole you now are primed to make a Latin meal tomorrow.  Or as a cook's privilege ruin your appetite with chips and salsa.
       
      
       **ingredients**
      8 Whole Wheat Pita  
      2 Pounds Yellow Squash
      1 Cup Grated Cheese
      2 Avocados
      1 Pound White mushrooms 
      2 Roma Tomatoes
      1 tablespoon oil
       
      ((spices))
      1 Cup Cilantro 
      1 Jalapeno Pepper
      2 Cloves Garlic
      1 Small Red Onion
      2 Juiced Limes
      1 teaspoon salt 
      
      **prep**  
      1. Make the Guacamole: Cut *avocado* in half, take out pits, and scoop out flesh. Cut the *pepper* in half and scoop out the seeds, then *finely chop* Cilantro, garlic, onion and tomatoes.  Use a fork to mash everything together, then sprinkle with salt and lime juice. If done ahead, place in a bowl and push plastic wrap onto the surface of the guacamole to keep it away from the air.  Otherwise it will turn black, which is still fine to eat but does not look as good.
      2. Wash and pat dry Yellow Squash and mushrooms. Slice Squash in halve length-wize, than make thick slices.  Slice mushrooms. Heat a pan, and saute both in oil until soft(about 10 minutes). Can be done ahead and refrigerated.   
      
        **cook**
      1. Spray cookie sheet with Pam, sprinkle cheese on the pita. Bake at 450 until the cheese melts.
      2. Top each with a few spoonfuls of guacamole and the mushrooms and squash.  Reheat the mushroom and sqash in a bowl beside the baking pitas if cooked ahead.
       
      This pita pizza can be sliced into wedges just like a pizza.  Or serve one to each person like a personal sized pizza.  Try it with a Mexican beer or some iced water with lime juice. 
      
      
