    - |+
      
      1. Preheat oven to 450.
      2. Cut off the garlic top to expose the cloves, brush with oil.
      3. Cut the squash in half and seed it.
      4. Place garlic cut side up on a greased cookie sheet, place the sage leaves on top, then cover it with the half squash like a helmet. Place the other half squash next to it.
      5. *Bake* at 450 for 25-30 minutes until you can easily push a knife through the squash, then remove from the oven to cool, throw out sage leaves
      6. Scoop out the squash and squeeze out the roasted garlic like a toothpaste tube.
      7. Place everything, including the stock into blender and *blend*.  Or use an immersion blender and blend directly in a pot.
      
      
      Since the majority of this recipe is waiting for the squash to bake, you can either relax and sip some wine(this soup will hold up to a great smoky Pinot Noir or a sweet Riesling) or make a quick side dish or two from Realmealz and still only spend about 30 minutes making dinner.
      
