      Cucumber Sausage Stir Fry
      
      **intro**
      
      One of the joys of cooking is being able to learn about new ingredients and cultures.  This recipe uses Chinese Sausage that will hold together stir fried.  You can use any sausage you prefer, it will still taste great!
       
      
       **ingredients**
      
      5 Chinese Sausages
      2 Conventional Cucumbers  
      1/2 Cup Basil
      1 Cup Chicken Stock
      1 Tablespoon Dry Sherry
      2 Tablespoons Oil
      1 Clove Garlic
      
      
      **prep**  
       
        **cook**
      1. Cut Cucumbers in half lengthwise, *de-seed* and then cut into the size of fries.
      2. Slice your Sausages diagonally into bite sized pieces, then *stir fry* for 3 minutes. 
      3. *Mince* your Garlic while the Sausage cooks and add it to the pan.
      4. Add your Cucumbers to the pan, then pour in the Sherry and Chicken stock and bring to a boil.
      5. Reduce your food to a *simmer*, cover the pan and cook for 5 more minutes.
      6. *Mince* your Basil while the Sausage and Cucumbers are simmering and stir it in at the end.
      
      You can serve this dish alone or pair it with white rice
      
