      Cucumber Mushroom Salad
      
      **intro**
      
      After you try this and find out how easy it is to make a salad dressing, you will be astounded to read all the extra ingredients they put into commercial dressings. 
      
        
       **ingredients**
      2 large Conventional Cucumbers
      1/2 Pound White Mushrooms
      
      ((dressing))
      1/2 Cup Parsley
      1/4 Cup lemon Juice
      1/2 Cup Olive oil
      1 Tablespoon water 
      1 teaspoon Cracked Black Pepper
      1 Teaspoon Dijon mustard
      1/2 Teaspoon Salt
      
      **prep**  
      1. *Blend* the Parsley with 1 tbsp of water until the Parsley is finely chopped, and then add Olive Oil, Lemon Juice and Mustard and blend on low until it becomes an *emulsion*.  Season to taste with Pepper and Salt. This dressing will last a week refrigerated in a covered jar.    
      
      
        **cook**
      1. Cut Cucumbers in half lengthwise, *de-seed* then cut into sticks.
      2. Rub the Mushrooms with a damp towel to get rid of any excess dirt, and then cut them loosely.
      3. Place your Cucumbers and Mushrooms in a large bowl and then drizzle on 3 Tablespoons of the dressing gently stirring to make sure it coats all the vegetables.  
      4. Refrigerate the salad until you are ready to enjoy your meal. 
       
      
      This recipe is great paired with fish or can be tossed into a pita bread with any of your leftovers to transform them into a yummy sandwich.
       
      
      
