      Caprese Sandwich
      
      **introduction**
      
      This playful take on a Classic Italian Salad gives it the American twist.  It's fun for kids to make as well.  Use it as an appetizing first course or a light meal. I recommend only making this sandwich during summer when you can buy awesome tomatoes.   
      
      
       **ingredients**
      3 Pounds of the ripest Tomatoes available to you 
      1 bunch of Basil leaves
      1 Pound Fresh Mozzarella 
      1 tbsp olive oil
        
      
      ((spices))
      2 Tablespoons Kosher Salt
      1 Tablespoon Coarse Pepper(freshly ground if possible)
      
      **prep**  
      
       
      **cook**
      1. Preheat your oven to 450  
      2. *Grate* or roughly cut your Mozzarella cheese and thickly slice your Tomatoes. 
      3. Wash and pat dry the Basil Leaves.
      4. Brush a cookie sheet with olive oil, or spray it with PAM.  Then cover with Tomato slices. Brush the slices with oil or sprak with PAM.  Then sprinkle cheese over the top of each slice. (Pick up any cheese that fell on your pan or it will burn in the oven).
      5. Bake the tomatoes until your cheese melts, 5-10 min, then allow the tomatoes to cool for a minute before assembling your sandwiches.
      6. Gather around and make your own sandwichs of Basil-Tomato-Basil.  Add salt and pepper to taste.
         
       
      A variation on this dish is thinly slice a Baguette of Sour dough, brush each slice with Olive Oil and then bake the slices at 450 for a few minutes until they are toasted.  While they toast you can chop your Tomatoes and Basil together and toss them in Olive Oil. Once toasted you can layer the bread with grated cheese and Tomatoes and top with a pinch of salt.  
      
      
