      Hummus
      
      **intro**
      This is a great versatile dish that can accompany any main dish or make a great sandwich for lunch. A batch will last a week covered in the refrigerator.
      You will be astounded by how much more less expensive and tasty it is to make your own hummus.
      
       **ingredients**
      2 (15 oz) cans of garbanzo beans (chickpeas), drained and rinsed
      1/3 cup of tahini(sesame seed paste)
      1/3 cup  lemon juice
      1/3 cup olive oil
      
      ((spices))
       2 garlic cloves
       1/2 teaspoon salt
         
      **prep**
      1. Peel garlic
      
      **cook**
      1. Pour garbano beans into a strainer and rinse with cool water
      2. In a food processor, combine all ingredients but the salt.  Process until smooth. (Reserve a few whole garbanzos to garnish)
      3.  Add salt to taste.
      4. Spoon into serving dish.  Top with whole garbanzos, drizzle of olive oil.  If you want to be extra fancy you can sprinkle on  paprika and chopped Parsley
      5. Turn on some Middle Eastern Music, grill some kababs, drink some cucumber-mint water and  dream of sunshine
      
      
      **serves**
      6
       
